import React from 'react';
import ReactDomClient from "react-dom/client";
import './index.css';
import App from './App';

const container = document.getElementById('app');

const root = ReactDomClient.createRoot(contrainer);

root.render(<App/>);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
